import React from 'react'
import styled from 'styled-components';

const TipModalContainer = styled.div`
    width: 100%;
    height: 100vh;
    background: rgba(0,0,0,0.5);
    position: absolute;
    z-index: 50;
`;

export default function TipModal() {
    return (
        <TipModalContainer>

        </TipModalContainer>
    )
}
